import './App.css';
import Home from './Home'
import Signup from './Signup'
import { Route, Routes } from 'react-router-dom'

function App() {
  return (
    <div>
      <Routes>
      <Switch>
      <Route path="/" element={<Home />} />
      <Route path="/signup" element={<Signup />} />
      </Switch>
      </Routes>
    </div>
  );
}

export default App;
